import { nominalTypeHack } from 'prop-types';

const headerContainer = () => {
    return (
        <React.Fragment>
            <CssBaseline />
            <Container maxWidth="lg" style ={{padding: '0px',backgroundColor: '#cfe8fc', height: '30vh'}}>
                <p>hello</p>
            </Container>
        </React.Fragment>
    )
}

export default headerContainer
